"use strict";

const input = `



`.split('\n');

const answer = [];
// Start point = 5
let position = { row: 2, column: 0};
const keypad = [
    [0, 0, 1, 0, 0],
    [0, 2, 3, 4, 0],
    [5, 6, 7, 8, 9],
    [0, 'A', 'B', 'C', 0],
    [0, 0, 'D', 0, 0],
];

for(let row of input) {
    let instructions = row.split('');
    for(let direction of instructions) {
        let backup = Object.assign({}, position);
        switch (direction) {
            case 'U':
                position.row--;
                break;
            case 'D':
                position.row++;
                break;
            case 'L':
                position.column--;
                break;
            case 'R':
                position.column++;
                break;
        }
        position.column = clamp(position.column);
        position.row = clamp(position.row);
        if(!isValid()) {
            position = backup;
        }
    }
    answer.push(calculateNumber());
}

console.log(answer.join(''));

function clamp(value) {
    return Math.min(Math.max(value, 0), 4);
}

function calculateNumber() {
    return keypad[position.row][position.column];
}

function isValid() {
    return keypad[position.row][position.column] !== 0;
}